import React, { Component, Fragment } from 'react';
import { Col, Container, Row } from 'react-bootstrap';

class About extends Component {
    render() {
        return (
            <Fragment>
                <Container>
                    <Row>
                        <Col>
                        </Col>
                        <Col>
                            <h3>Welcome to HealthCare</h3>
                            <h1>Best Care For Your</h1>
                            <h1>Good Health</h1>
                            <p>
                                Consectetur dolore amet velit tempor do voluptate consequat Lorem commodo eu minim. Nulla irure sit nulla laboris occaecat veniam id fugiat fugiat ex. Aliquip cupidatat occaecat Lorem sint. Ullamco sint laborum aute laboris sit aliquip do ipsum exercitation Lorem voluptate eu. Consequat qui ea magna esse commodo proident eiusmod pariatur do nulla adipisicing ex. Cupidatat ad labore est ea in et cupidatat irure dolor do tempor ipsum id.
                            </p>
                            <i class="fas fa-angle-double-right"></i>
                        </Col>
                    </Row>
                </Container>
            </Fragment>
        );
    }
}

export default About;
